        "Icon": "UI_ChapterIcon_Sigewinne",
        "Intro": "В праздничные дни на улицах Кур-де-Фонтейна иногда можно встретить молодую девушку с ушками мелюзины и человеческим лицом - это старшая медсестра крепости Меропид, приехавшая насладиться отпуском.<br>Но почему у неё такой вид? Хотя почти у каждого жителя Фонтейна на этот счёт своя теория, консенсус не достигнут.<br>Немногие знают, что ответ на этот вопрос связан с событием, которое произошло много столетий назад. Событием, о котором она вспоминает с улыбкой.<br>Этот фрагмент её прошлого долгие годы хранился в глубинах её сердца, превратившись в удивительную историю. Если вам удастся завоевать её доверие и подружиться, она поделится этой историей и с вами."
